import logo from './logo.svg';
import './App.css';
import { useState } from 'react';

function App() {

  const [prompt, setPrompt] = useState("Bla Bla Bla");
  const [genre, setGenre] = useState("Rock");

  const handleChange = (event) => {
    setPrompt(event.target.value)
  }
  return (
    <div class='App'>
      <div class='App'>
        <form>
          <label>Enter prompt: </label>
          <textarea value={prompt} onChange={handleChange} />
        </form>
      </div>
      <div class='App'>
        <select>
          <option value="Rock">Ford</option>
          <option value="Funk" selected>Volvo</option>
          <option value="Jazz">Fiat</option>
        </select>
      </div>
    </div>
  );
}

export default App;
